import DragAndDropUpload from './components/DragAndDropUpload';

const App = () => {
  return (
    <div className="App">
      <h1 className='m-8 mb-14 font-extrabold tracking-wide'>Video Metadata Generator</h1>
      <DragAndDropUpload/>
    </div>
  );
};

export default App;
